import './App.css';
import {BrowserRouter as Router ,Route} from "react-router-dom";
import Login from './components/Login';
import StockHome from './components/StockHome';
function App() {
  return (
    <div className="App">
    <Router>
    <Route path="/"><Login/></Route>
     <Route path='/test'><StockHome/></Route>
    </Router>
    </div>
  );
}

export default App;
